(77, 1, 2, 1, 'وَيَقَوْمٍ لَا يَجْرِ مَنْكُمْ شِقَافِي أَن يُصِيبَكُم مِثْلُ مَا أَصَابَ قَوْمَ نُوحٍ أَوْ قَوْمَ هُودِ أَوْقَوْمَ صَلِحُ وَمَاقَوْمُ لوط منكم بعيد وَاسْتَغْفِرُوا ربك ثُمَّ تُونُوا إِلَيْهِ إِنْ رَبِّي رَحِيمٌ وَدُودُ قَالُوا يَشْعَيْبُ مَا نَفْقَهُ كَثِيرًا مِّمَّا تَقُولُ وَإِنَّا لَتَرِيكَ فِينَا ضَعِيفًا وَلَوْلَا رَهْطُكَ لَرَجَمْنَكَ وَمَا أَنت َ عَلَيْنَا بِعَزِيقَالَ يَقَوْمِ أَرَهْلِي أَعَزَّ عَلَيْكُم مِنَ اللَّهِ وَاخَذْ تُمُوهُ وَرَاءَ كُمْ ظِهْرِنَا إِنَّ رَنِي بِمَا تَعْمَلُونَ يُحِيطُوَيَقَوْمٍ أَعْمَلُوا عَلَى مَكَانَيْكُمْ إِنِّي عَمِل سَوْفَ تَعْلَمُونَ مَن يَأْتِبِهِ عَذَابٌ يُخْزِيهِ وَمَنْ هُوَ كَذِبٌ وَارْتَقِبُوا إِنِّي مَعَكُمْ رَقِيبُ وَلَمَّا جَاءَ أَمْ نَا نَعْنَا تُعيبًا وَالَّذِينَ آمَنُوا مَعَهُ بِرَحْمَةِ مِنَا وَأَخْذَتِ الَّذِينَ ظَلَمُوا الشَّيْحَةُ فَأَصْبَحُوا فِي دِيرِهِمْ جَمِينَ كَانَ أَمْ يَعْنوا فِيهَا الَا يُعد المدين كمَا جِدَتْ تَمُودُ وَلَقَدْ أَمْ سَلْنَا مُوسَى يَتَابَيْنَا وَسُلْطَان مُّبِينَ إِلَى فِرْعَوْن َ وَلَا يُهِ فَالْبَعُوا أَمْ رَعُونَ وَمَا أَمْرُ فِعُونَ بِرَشِيد', 1, 0, 0, 0, '2025-03-19 17:02:41', NULL, 'نص', 0, '2025-03-20 01:13:35', '2025-03-20 01:18:46'),
