INSERT INTO `departments` (`id`, `name`, `short_name`, `college_id`, `levels`, `description`, `created_at`, `updated_at`) VALUES
(1, 'تكنولوجيا المعلومات', 'IT', 1, 4, 'تتضمن كلية الحاسبات والمعلومات عدد من الأقسام والتخصصات المميزة، ومن أفضل هذه التخصصات ما يلي: يعد هذا القسم من أفضل أقسام كلية حاسبات ومعلومات، ويقوم على تعليم العديد من المواد ولغات البرمجة الأساسية.', '2025-03-03 19:07:22', '2025-03-03 19:07:22'),
(2, 'علوم الحاسوب', 'CS', 1, 4, 'تعد كلية الحاسبات والمعلومات من الكليات الهامة بالأخص في الوقت الحالي، نظراً لتواجد التكنولوجيا بشكل موسع، واعتماد الكثير من الصناعات على المجال التكنولوجي.', '2025-03-03 19:09:01', '2025-03-03 19:09:01'),
(3, 'هندسة مدني', 'CE', 2, 4, NULL, '2025-03-04 08:28:29', '2025-03-04 08:28:29'),
(4, 'قسم الجغرافيا', 'Geo', 5, 4, NULL, '2025-03-09 04:49:56', '2025-03-09 04:49:56'),
(5, 'قسم التاريخ والعلوم السياسية', 'HPS', 5, 4, NULL, '2025-03-09 04:50:27', '2025-03-09 04:50:27'),
(6, 'قسم الطب البيطري', 'VM', 7, 3, 'تأسست كلية الطب البيطري في عام  2005', '2025-04-04 20:03:16', '2025-04-04 20:03:16'),
(7, 'قسم الميكاترونكس', 'Mecha', 2, 4, NULL, '2025-04-05 21:03:15', '2025-04-05 21:03:15'),
(8, 'قسم الهندسة المعمارية', 'AE', 2, 2, 'تأسس قسم الهندسة المعمارية عام 1998 /1999م.  كنواه اولى لكلية الهندسة والسدود في جامعة ذمار، ويمنح القسم شهادة البكالوريوس في الهندسة المعمارية (خمس سنوات)، تخرج من القسم منذ تأسيسه وحتى العام الجامعي2022 /2023م. (21) دفعة - ما يزيد عن 1100 مهندس معماري أستطاع الكثير منهم تحقيق إنجازات معمارية ومهنية على المستوى المحلي والإقليمي.\r\n\r\nتتراوح اعداد القبول السنوية ما بين 50-60 طالب وطالبة، بالإضافة الى قبول طلبة المنح التي تقدمها الوزارة.\r\n\r\nالمقررات التطبيقية في القسم تشمل: مقررات مبادئ التكوين المعماري، التصميم المعماري، التخطيط الحضري، التصميم الحضري تركيب المباني، التصميم الداخلي، تصميم وتنسيق الحدائق وغيرها فضلا عن المواد النظرية: تاريخ ونظريات العمارة وتاريخ ونظريات تخطيط المدن ونظريات التصميم الحضري وعلم الجمال والنقد المعماري والإسكان والتحكم البيئي وقوانين البناء وتكنولوجيا العمارة ....الخ. والمواد المساندة كمواد البناء والمساحة والانشاءات والخرسانة المسلحة والمنشآت المعدنية وخدمات المباني والهندسة الصحية ومتطلبات الجامعة كاللغة العربية والانجليزية والثقافة الوطنية وفقا لهدف كل مستوى وبوحدات دراسية متوازنة وفقا لمعايير الاعتماد الأكاديمي وضمان جودة التعليم العالي.', '2025-04-05 21:04:15', '2025-04-05 21:04:15'),
(9, 'قسم طب الأطفال', 'PE', 8, 5, 'قسم الاطفال هو احد اقسام الدائرة السريرية بكلية الطب وبالرغم من العدد المحدود لأعضاء هيئة التدريس فان القسم يقوم بتغطية الجانب النظري والتدريب العملي للطلبة بشكل جيد، ففي الجانب النظري يقوم اعضاء هيئة التدريس بتغطية معظم افرع طب الاطفال والتي تشمل النمو والتطور ، الرعاية الصحية الأولية واللقاحات ، امراض التغذية ، الامراض الوراثية والاستقلابية والمناعية وكذلك امراض الجهاز الهضمي والجهاز التنفسي وامراض القلب بالإضافة الى امراض الدم والكلى وامراض الجهاز العصبي. كما يقوم اعضاء هيئة التدريس بخدمة المجتمع المتمثل بعملهم في قسم الاطفال بالمستشفى الجامعي وعياداته الخارجية ويحتوي قسم الاطفال في المستشفى على الوحدات التالية:1- وحدة حديثي الولادة2- العناية المركزة3-  وحدة امراض الجهاز التنفسي4- وحدة التغذية5- الوحدة العامة لبقية امراض طب الاطفال ويطمح القسم في حالة توفر الكادر التدريسي الكافي والمؤهل الى فتح الوحدات التالية:1- وحدة امراض القلب2- وحدة امراض الدم والاورام3- وحدة امراض الكلى4- وحدة امراض الجهاز العصبي5- وحدة خاصه بالأمراض الجينية والاستقلابية والمناعية', '2025-04-08 10:49:09', '2025-04-08 10:49:09'),
(10, 'قسم التشريح والأنسجة', 'AH', 8, 5, NULL, '2025-04-08 10:50:16', '2025-04-08 10:50:16'),
(11, 'قسم علم وظائف الأعضاء', 'PH', 8, 6, 'قسم الفسيولوجي أحد أقسام العلوم الأساسية   في الكلية الذي تأسس منذ بداية  تأسيس كلية الطب البشري، والعلوم الصحية في العام 1998 م. يقوم القسم بتدريس علم وظائف الأعضاء لطلاب المستوى الأول والثاني ضمن برنامج  درجة البكالوريوس فى الطب و الجراحة بكلية الطب البشري .', '2025-04-08 10:51:01', '2025-04-08 10:51:01'),
(12, 'قسم الكيمياء الحيوية', 'BI', 8, 6, NULL, '2025-04-08 10:51:44', '2025-04-08 10:51:44'),
(13, 'قسم علم الأمراض', 'PA', 8, 6, NULL, '2025-04-08 10:52:14', '2025-04-08 10:52:14'),
(14, 'قسم الجراحة', 'SU', 8, 5, NULL, '2025-04-08 10:52:41', '2025-04-08 10:52:41'),
(15, 'قسم الباطنة', 'IM', 8, 6, NULL, '2025-04-08 10:53:09', '2025-04-08 10:53:09'),
(16, 'قسم علم الأدوية والسموم', 'PT', 8, 6, 'يعتبر قسم علم الادوية والسموم من الاقسام المهمة جدا لطالب الطب البشري حيث هي تعتبر المكملة لما درسه سابقا في الاقسام الاخرى الاساسية والتطبيقية ويمهد له الطريق للدخول الى المرحلة السريرية   . .. فلا بد لخريج الطب بعد ان يشخص المرض من ان يعرف  الادوية والعقاقير التي تعالج الامراض المختلفة مع جرعاتها والية عملها والاعراض الجانبية الممكن حدوثها وكيفية تجنبها ومعالجتها عند حصولها. .. كما ان الطالب يتعرف على الطرق العلاجية المختلفة وفترات الاستخدام واختيار الافضل منها لمعالجة كل حالة .', '2025-04-08 10:53:44', '2025-04-08 10:53:44');
