(1, '8821546', 'انترنت الاشياء', 'من المحاضرات كامل', 'عربي', 'اختيارات', 1, 'المستوى الرابع', 8, '[{\"option_1\": \"MQTT\", \"option_2\": \"HTTP\", \"option_3\": \"CoAP\", \"option_4\": \"WebSocket\", \"question\": \"ما هو البروتوكول الأكثر استخدامًا في تطبيقات الويب لإنترنت الأشياء؟\", \"correct_answer\": \"HTTP\"}, {\"option_1\": \"HTTP\", \"option_2\": \"CoAP\", \"option_3\": \"WebSocket\", \"option_4\": \"FTP\", \"question\": \"أي من البروتوكولات التالية يتميز بالكفاءة في استهلاك الطاقة؟\", \"correct_answer\": \"CoAP\"}, {\"option_1\": \"توفير أمان عالي\", \"option_2\": \"تقليل استهلاك البيانات والطاقة\", \"option_3\": \"سرعة نقل البيانات\", \"option_4\": \"سهولة التشفير\", \"question\": \"ما الفائدة الأساسية من استخدام بروتوكول MQTT في إنترنت الأشياء؟\", \"correct_answer\": \"تقليل استهلاك البيانات والطاقة\"}, {\"option_1\": \"طبقة النقل\", \"option_2\": \"طبقة التطبيق\", \"option_3\": \"طبقة الربط البيانات\", \"option_4\": \"طبقة الجلسة\", \"question\": \"أي من الطبقات التالية لا تنتمي إلى نموذج TCP/IP؟\", \"correct_answer\": \"طبقة الجلسة\"}, {\"option_1\": \"توفير اتصال ثنائي الاتجاه بين العميل والخادم\", \"option_2\": \"تشفير البيانات بين الأجهزة\", \"option_3\": \"تقليل استهلاك الطاقة\", \"option_4\": \"تحسين أمان HTTP\", \"question\": \"ما هو الغرض الرئيسي من WebSocket؟\", \"correct_answer\": \"توفير اتصال ثنائي الاتجاه بين العميل والخادم\"}, {\"option_1\": \"إنترنت الأشياء\", \"option_2\": \"الحوسبة السحابية\", \"option_3\": \"الشبكات الافتراضية\", \"option_4\": \"البلوك تشين\", \"question\": \"ما هي الخدمة التي توفر موارد حاسوبية عبر الإنترنت بناءً على الطلب؟\", \"correct_answer\": \"الحوسبة السحابية\"}, {\"option_1\": \"أجهزة الاستشعار\", \"option_2\": \"السحابة\", \"option_3\": \"البروتوكولات\", \"option_4\": \"جميع ما سبق\", \"question\": \"أي من التالي هو أحد مكونات إنترنت الأشياء؟\", \"correct_answer\": \"جميع ما سبق\"}, {\"option_1\": \"MQTT أكثر كفاءة من حيث استهلاك البيانات والطاقة\", \"option_2\": \"HTTP أسرع من MQTT\", \"option_3\": \"HTTP يدعم الاتصالات الثنائية الاتجاه فقط\", \"option_4\": \"MQTT يستخدم منفذ 80\", \"question\": \"ما الفرق بين HTTP و MQTT؟\", \"correct_answer\": \"MQTT أكثر كفاءة من حيث استهلاك البيانات والطاقة\"}, {\"option_1\": \"HTTP\", \"option_2\": \"WebSocket\", \"option_3\": \"MQTT\", \"option_4\": \"FTP\", \"question\": \"أي من هذه البروتوكولات يعمل وفق نموذج نشر/اشتراك؟\", \"correct_answer\": \"MQTT\"}, {\"option_1\": \"Spark\", \"option_2\": \"Hadoop\", \"option_3\": \"Kafka\", \"option_4\": \"جميع ما سبق\", \"question\": \"أي من هذه التقنيات تُستخدم لمعالجة البيانات الضخمة في إنترنت الأشياء؟\", \"correct_answer\": \"جميع ما سبق\"}, {\"option_1\": \"التحكم في الأجهزة المنزلية الذكية\", \"option_2\": \"التخزين السحابي\", \"option_3\": \"إدارة الشبكات الافتراضية\", \"option_4\": \"حماية البيانات\", \"question\": \"ما هو بروتوكول CoAP مصمم من أجله؟\", \"correct_answer\": \"التحكم في الأجهزة المنزلية الذكية\"}, {\"option_1\": \"Edge Computing يحدث بالقرب من الأجهزة المتصلة\", \"option_2\": \"Cloud Computing أكثر كفاءة للطاقة\", \"option_3\": \"Edge Computing يعتمد على الخوادم المركزية\", \"option_4\": \"Cloud Computing أسرع من Edge Computing\", \"question\": \"ما الفرق الأساسي بين Edge Computing و Cloud Computing؟\", \"correct_answer\": \"Edge Computing يحدث بالقرب من الأجهزة المتصلة\"}]', '2025-04-01 18:46:05', '2025-04-01 18:46:05'),
(2, '8754120', 'ادارة نظم', 'ادارة نظم\r\n\r\nلتجربة', 'انجليزي', 'اختيارات', 1, 'المستوى الرابع', 8, '[{\"option_1\": \"Develop software applications\", \"option_2\": \"Monitor and maintain IT systems\", \"option_3\": \"Design marketing strategies\", \"option_4\": \"Manage financial accounts\", \"question\": \"What is the primary role of a System Administrator?\", \"correct_answer\": \"Monitor and maintain IT systems\"}, {\"option_1\": \"Network Administrator\", \"option_2\": \"Security Systems Administrator\", \"option_3\": \"Database Administrator\", \"option_4\": \"System Analyst\", \"question\": \"Which type of administrator is responsible for managing databases?\", \"correct_answer\": \"Database Administrator\"}, {\"option_1\": \"Design computer networks\", \"option_2\": \"Monitor and maintain security systems\", \"option_3\": \"Develop mobile applications\", \"option_4\": \"Analyze business data\", \"question\": \"What is the function of a Security Systems Administrator?\", \"correct_answer\": \"Monitor and maintain security systems\"}]', '2025-04-01 21:09:50', '2025-04-01 21:09:50'),
(3, '5150170', 'انترنت الاشياء', 'تجربة فقط 4 اسئلة', 'عربي', 'اختيارات', 1, 'المستوى الرابع', 8, '[{\"option_1\": \"MQTT\", \"option_2\": \"HTTP\", \"option_3\": \"CoAP\", \"option_4\": \"WebSocket\", \"question\": \"ما هو البروتوكول الأكثر استخدامًا في تطبيقات الويب لإنترنت الأشياء؟\", \"correct_answer\": \"HTTP\"}, {\"option_1\": \"HTTP\", \"option_2\": \"CoAP\", \"option_3\": \"WebSocket\", \"option_4\": \"FTP\", \"question\": \"أي من البروتوكولات التالية يتميز بالكفاءة في استهلاك الطاقة؟\", \"correct_answer\": \"CoAP\"}, {\"option_1\": \"توفير أمان عالي\", \"option_2\": \"تقليل استهلاك البيانات والطاقة\", \"option_3\": \"سرعة نقل البيانات\", \"option_4\": \"سهولة التشفير\", \"question\": \"ما الفائدة الأساسية من استخدام بروتوكول MQTT في إنترنت الأشياء؟\", \"correct_answer\": \"تقليل استهلاك البيانات والطاقة\"}, {\"option_1\": \"طبقة النقل\", \"option_2\": \"طبقة التطبيق\", \"option_3\": \"طبقة الربط البيانات\", \"option_4\": \"طبقة الجلسة\", \"question\": \"أي من الطبقات التالية لا تنتمي إلى نموذج TCP/IP؟\", \"correct_answer\": \"طبقة الجلسة\"}]', '2025-04-01 21:52:56', '2025-04-01 21:52:56'),
(4, '6386807', 'اختبار انترنت الاشياء', 'اختبار صح و خطأ \r\n\r\nتجربة 😁', 'عربي', 'صح و خطأ', 1, 'المستوى الرابع', 17, '[{\"answer\": \"صح\", \"question\": \"بروتوكول HTTP هو الأكثر استخدامًا في تطبيقات الويب لإنترنت الأشياء.\"}, {\"answer\": \"خطأ\", \"question\": \"MQTT أقل كفاءة من HTTP في استهلاك البيانات والطاقة.\"}, {\"answer\": \"صح\", \"question\": \"CoAP يُستخدم غالبًا في الأجهزة ذات الموارد المحدودة.\"}, {\"answer\": \"خطأ\", \"question\": \"WebSocket هو بروتوكول يعتمد على نموذج نشر/اشتراك.\"}, {\"answer\": \"صح\", \"question\": \"الحوسبة السحابية توفر موارد حاسوبية عبر الإنترنت بناءً على الطلب.\"}, {\"answer\": \"خطأ\", \"question\": \"MQTT يستخدم بشكل أساسي لنقل الفيديو عالي الجودة في إنترنت الأشياء.\"}, {\"answer\": \"صح\", \"question\": \"CoAP يُفضل على HTTP عندما يكون استهلاك الطاقة عاملاً مهمًا.\"}, {\"answer\": \"خطأ\", \"question\": \"إنترنت الأشياء يعتمد فقط على البروتوكولات السلكية للاتصال بين الأجهزة.\"}, {\"answer\": \"صح\", \"question\": \"Edge Computing يقلل الحاجة إلى إرسال جميع البيانات إلى السحابة للمعالجة.\"}, {\"answer\": \"صح\", \"question\": \"DDS هو بروتوكول مصمم لنقل البيانات بزمن استجابة منخفض.\"}, {\"answer\": \"خطأ\", \"question\": \"في نموذج نشر/اشتراك، يجب أن يكون العميل متصلاً بالخادم دائمًا لاستقبال الرسائل.\"}, {\"answer\": \"صح\", \"question\": \"TCP هو بروتوكول أكثر موثوقية من UDP في نقل البيانات.\"}, {\"answer\": \"خطأ\", \"question\": \"إنترنت الأشياء لا يحتاج إلى أي شكل من أشكال التشفير للحفاظ على الأمان.\"}, {\"answer\": \"صح\", \"question\": \"WebSocket يسمح باتصال ثنائي الاتجاه بين العميل والخادم.\"}, {\"answer\": \"خطأ\", \"question\": \"الحوسبة السحابية تلغي الحاجة إلى أجهزة استشعار في إنترنت الأشياء.\"}, {\"answer\": \"صح\", \"question\": \"MQTT يعمل على نموذج نشر/اشتراك باستخدام بروتوكول TCP.\"}, {\"answer\": \"صح\", \"question\": \"CoAP يستخدم بروتوكول UDP بدلاً من TCP.\"}, {\"answer\": \"صح\", \"question\": \"IoT Gateway يساعد في تحسين الأمان وإدارة البيانات في الشبكة.\"}, {\"answer\": \"خطأ\", \"question\": \"جميع أجهزة إنترنت الأشياء تحتاج إلى اتصال دائم بالإنترنت للعمل.\"}, {\"answer\": \"صح\", \"question\": \"طبقة التطبيق في نموذج TCP/IP تشمل بروتوكولات مثل HTTP و MQTT.\"}]', '2025-04-02 21:04:14', '2025-04-02 21:04:14'),
(5, '4916174', 'تجربة بسيطة', 'تجربة فقط', 'عربي', 'صح و خطأ', 1, 'المستوى الرابع', 17, '[{\"answer\": \"صح\", \"question\": \"بروتوكول HTTP هو الأكثر استخدامًا في تطبيقات الويب لإنترنت الأشياء.\"}, {\"answer\": \"خطأ\", \"question\": \"MQTT أقل كفاءة من HTTP في استهلاك البيانات والطاقة.\"}, {\"answer\": \"صح\", \"question\": \"CoAP يُستخدم غالبًا في الأجهزة ذات الموارد المحدودة.\"}, {\"answer\": \"خطأ\", \"question\": \"WebSocket هو بروتوكول يعتمد على نموذج نشر/اشتراك.\"}]', '2025-04-02 21:45:30', '2025-04-02 21:45:30');
