(1, 'جامعة ذمار', 'images/logo/969675.png', '777000666', 'superadmin@gmail.com', 'جامعة ذمار هي جامعة يمنية حكومية حديثة تقع في مدينة ذمار في اليمن. تأسست في 24/8/1996م وهي تعمل منذ نشأتها على رفع المستوى العلمي والثقافي والفكري في عموم الجمهورية وفي محافظة ذمار على وجه خاص ويبلغ عدد الطلاب المسجلين في الجامعة 20 ألف طالبا وطالبة. وتضم الجامعة العديد من الكليات العلمية والإنسانية وتشمل كل كلية على مجموعة من الأقسام المتخصصة وفقاً لأولويات البحث العلمي والتنمية وعلى ضوء برامج تعد لكل تخصص.', 'https://www.tu.edu.ye/', '2025-04-05 17:45:35', '2025-04-05 17:45:35');
